import { fromJS } from 'immutable';

export const defaultState = fromJS({
  topicList: [{
    id: 1,
    title: '随笔',
    imgUrl:'https://upload.jianshu.io/collections/images/1767718/crop1557956823393.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/48/h/48/format/webp'
  },{
    id: 2,
    title: '三行情书',
    imgUrl:'https://upload.jianshu.io/collections/images/1811898/crop1565950823559.jpg?imageMogr2/auto-orient/strip|imageView2/1/w/48/h/48/format/webp'
  }]
});

export default (state = defaultState, action) => {
  switch(action.type) {
    default:
      return state;
  }
}
